CREATE TABLE [ROOMS] (
    [building_code]    VARCHAR (5)  DEFAULT (NULL) NULL,
    [room_code]        VARCHAR (13) DEFAULT ('') NOT NULL,
    [capacity]         INT          DEFAULT (NULL) NULL,
    [wheelchair]       INT          DEFAULT (NULL) NULL,
    [projector]        INT          DEFAULT (NULL) NULL,
    [visualiser]       INT          DEFAULT (NULL) NULL,
    [whiteboard]       INT          DEFAULT (NULL) NULL,
    [computer]         INT          DEFAULT (NULL) NULL,
    [video_dvd]        INT          DEFAULT (NULL) NULL,
    [pa_system]        INT          DEFAULT (NULL) NULL,
    [radio_microphone] INT          DEFAULT (NULL) NULL,
    [lecture_capture]  INT          DEFAULT (NULL) NULL,
    [tiered]           INT          DEFAULT (NULL) NULL,
    [flat]             INT          DEFAULT (NULL) NULL,
    PRIMARY KEY CLUSTERED ([room_code] ASC)
);

